  array('id' => '1287','lang_key' => 'good_morning_quote','type' => '','english' => 'Every new day is a chance to change your life.','arabic' => 'كل يوم جديد هو فرصة لتغيير حياتك.','dutch' => 'Elke nieuwe dag is een kans om je leven te veranderen.','french' => 'Chaque nouveau jour est une chance de changer de vie.','german' => 'Jeder neue Tag ist eine Chance, dein Leben zu verändern.','italian' => 'Ogni nuovo giorno Ã¨ un&#039;opportunitÃ  per cambiare la tua vita.','portuguese' => 'Todo novo dia é uma chance de mudar sua vida.','russian' => 'Каждый новый день - это шанс изменить вашу жизнь.','spanish' => 'Cada nuevo día es una oportunidad para cambiar tu vida.','turkish' => 'Her yeni günde hayatınızı değiştirmek için bir şans.'),
  array('id' => '1288','lang_key' => 'good_afternoon_quote','type' => '','english' => 'May this afternoon be light, blessed, enlightened, productive and happy.','arabic' => 'نرجو أن يكون هذا المساء خفيفًا ومباركًا ومستنيرًا ومنتجًا وسعيدًا.','dutch' => 'Moge vanmiddag licht, gezegend, verlicht, productief en gelukkig zijn.','french' => 'Puisse cet après-midi être léger, béni, éclairé, productif et heureux.','german' => 'Möge heute Nachmittag hell, gesegnet, erleuchtet, produktiv und glücklich sein.','italian' => 'Possa questo pomeriggio essere leggero, benedetto, illuminato, produttivo e felice.','portuguese' => 'Que esta tarde seja leve, abençoada, iluminada, produtiva e feliz.','russian' => 'Пусть сегодня днем светлый, благословенный, просвещенный, продуктивный и счастливый.','spanish' => 'Que esta tarde sea luz, bendita, iluminada, productiva y feliz.','turkish' => 'Bu öğleden sonra hafif, kutsanmış, aydınlanmış, üretken ve mutlu olabilir.'),
  array('id' => '1289','lang_key' => 'good_evening_quote','type' => '','english' => 'Evenings are life’s way of saying that you are closer to your dreams.','arabic' => 'الأمسيات هي طريقة الحياة للقول بأنك أقرب إلى أحلامك.','dutch' => 'Avonden zijn de manier om te zeggen dat je dichter bij je dromen bent.','french' => 'Les soirées sont la manière de la vie de dire que vous êtes plus proche de vos rêves.','german' => 'Abende sind die Lebensart zu sagen, dass Sie Ihren Träumen näher sind.','italian' => 'Le sere sono il modo in cui la vita ti dice che sei piÃ¹ vicino ai tuoi sogni.','portuguese' => 'As noites são a maneira da vida de dizer que você está mais perto de seus sonhos.','russian' => 'Вечера - это способ жизни сказать, что вы ближе к своим мечтам.','spanish' => 'Las noches son la forma en que la vida dice que estás más cerca de tus sueños.','turkish' => 'Akşamlar yaşamın, hayallerinize daha yakın olduğunuzu söyleme biçimidir.'),
