  array('id' => '1295','lang_key' => 'sign_in_attempt','type' => '','english' => 'Your sign in attempt seems a little different than usual, This could be because you are signing in from a different device or a different location.','arabic' => 'تبدو محاولة تسجيل الدخول مختلفة قليلاً عن المعتاد ، وقد يرجع هذا إلى أنك تقوم بتسجيل الدخول من جهاز مختلف أو موقع مختلف.','dutch' => 'Uw inlogpoging lijkt een beetje anders dan anders. Dit zou kunnen zijn omdat u zich aanmeldt vanaf een ander apparaat of een andere locatie.','french' => 'Votre tentative de connexion semble légèrement différente de celle habituelle. Cela peut être dû au fait que vous vous connectez depuis un autre appareil ou un autre emplacement.','german' => 'Ihr Anmeldeversuch scheint ein wenig anders als sonst. Dies könnte daran liegen, dass Sie sich von einem anderen Gerät oder einem anderen Standort aus anmelden.','italian' => 'Il tuo tentativo di accesso sembra leggermente diverso dal solito. Ciò potrebbe essere dovuto al fatto che stai effettuando l&#039;accesso da un dispositivo diverso o da un&#039;altra posizione.','portuguese' => 'Sua tentativa de login parece um pouco diferente do normal. Isso pode ter ocorrido porque você está fazendo login de um dispositivo diferente ou de um local diferente.','russian' => 'Ваша попытка входа выглядит немного иначе, чем обычно. Это может быть связано с тем, что вы входите с другого устройства или в другое место.','spanish' => 'El intento de inicio de sesión parece un poco diferente de lo habitual. Esto podría deberse a que se está iniciando desde un dispositivo diferente o desde una ubicación diferente.','turkish' => 'Oturum açma girişiminiz normalden biraz farklı görünüyor, Bunun nedeni farklı bir cihazdan veya farklı bir konumdan oturum açmanız olabilir.'),
  array('id' => '1296','lang_key' => 'we_have_sent_you_code','type' => '','english' => 'We have sent you an email with the confirmation code.','arabic' => 'لقد أرسلنا لك رسالة إلكترونية تحتوي على رمز التأكيد.','dutch' => 'We hebben u een e-mail gestuurd met de bevestigingscode.','french' => 'Nous vous avons envoyé un email avec le code de confirmation.','german' => 'Wir haben Ihnen eine E-Mail mit dem Bestätigungscode gesendet.','italian' => 'Ti abbiamo inviato un&#039;e-mail con il codice di conferma.','portuguese' => 'Enviamos um e-mail para você com o código de confirmação.','russian' => 'Мы отправили вам электронное письмо с кодом подтверждения.','spanish' => 'Te hemos enviado un correo electrónico con el código de confirmación.','turkish' => 'Onay kodunu içeren bir e-posta gönderdik.'),
  array('id' => '1297','lang_key' => 'two_factor','type' => '','english' => 'Two-factor authentication','arabic' => 'توثيق ذو عاملين','dutch' => 'Twee-factor-authenticatie','french' => 'Authentification à deux facteurs','german' => 'Zwei-Faktor-Authentifizierung','italian' => 'Autenticazione a due fattori','portuguese' => 'Autenticação de dois fatores','russian' => 'Двухфакторная аутентификация','spanish' => 'Autenticación de dos factores','turkish' => 'İki faktörlü kimlik doğrulama'),
  array('id' => '1298','lang_key' => 'to_log_in_two_factor','type' => '','english' => 'To log in, you need to verify your identity.','arabic' => 'لتسجيل الدخول ، تحتاج إلى التحقق من هويتك.','dutch' => 'Om u aan te melden, moet u uw identiteit verifiëren.','french' => 'Pour vous connecter, vous devez vérifier votre identité.','german' => 'Um sich einzuloggen, müssen Sie Ihre Identität bestätigen.','italian' => 'Per accedere, è necessario verificare la propria identità.','portuguese' => 'Para fazer login, você precisa verificar sua identidade.','russian' => 'Чтобы войти в систему, вам необходимо подтвердить свою личность.','spanish' => 'Para iniciar sesión, necesita verificar su identidad.','turkish' => 'Giriş yapmak için kimliğinizi doğrulamanız gerekir.'),
  array('id' => '1299','lang_key' => 'sent_two_factor_both','type' => '','english' => 'We have sent you the confirmation code to your phone and to your email address.','arabic' => 'لقد أرسلنا إليك رمز التأكيد إلى هاتفك وإلى عنوان بريدك الإلكتروني.','dutch' => 'We hebben je de bevestigingscode gestuurd naar je telefoon en naar je e-mailadres.','french' => 'Nous vous avons envoyé le code de confirmation sur votre téléphone et sur votre adresse e-mail.','german' => 'Wir haben Ihnen den Bestätigungscode an Ihr Telefon und an Ihre E-Mail-Adresse gesendet.','italian' => 'Ti abbiamo inviato il codice di conferma sul tuo telefono e sul tuo indirizzo email.','portuguese' => 'Enviamos o código de confirmação para o seu telefone e para o seu endereço de e-mail.','russian' => 'Мы отправили вам код подтверждения на ваш телефон и на ваш адрес электронной почты.','spanish' => 'Le hemos enviado el código de confirmación a su teléfono y a su dirección de correo electrónico.','turkish' => 'Size onay kodunu telefonunuza ve e-posta adresinize gönderdik.'),
  array('id' => '1300','lang_key' => 'sent_two_factor_email','type' => '','english' => 'We have sent you the confirmation code to your email address.','arabic' => 'لقد أرسلنا إليك رمز التأكيد إلى عنوان بريدك الإلكتروني.','dutch' => 'We hebben je de bevestigingscode gestuurd naar je e-mailadres.','french' => 'Nous vous avons envoyé le code de confirmation à votre adresse e-mail.','german' => 'Wir haben Ihnen den Bestätigungscode an Ihre E-Mail-Adresse gesendet.','italian' => 'Ti abbiamo inviato il codice di conferma al tuo indirizzo email.','portuguese' => 'Nós lhe enviamos o código de confirmação para o seu endereço de e-mail.','russian' => 'Мы отправили вам код подтверждения на ваш адрес электронной почты.','spanish' => 'Le hemos enviado el código de confirmación a su dirección de correo electrónico.','turkish' => 'Size e-posta adresinize onay kodunu gönderdik.'),
  array('id' => '1301','lang_key' => 'sent_two_factor_phone','type' => '','english' => 'We have sent you the confirmation code to your phone number.','arabic' => 'لقد أرسلنا إليك رمز التأكيد إلى رقم هاتفك.','dutch' => 'We hebben je de bevestigingscode naar je telefoonnummer gestuurd.','french' => 'Nous vous avons envoyé le code de confirmation sur votre numéro de téléphone.','german' => 'Wir haben Ihnen den Bestätigungscode an Ihre Telefonnummer gesendet.','italian' => 'Ti abbiamo inviato il codice di conferma al tuo numero di telefono.','portuguese' => 'Enviamos o código de confirmação para o seu número de telefone.','russian' => 'Мы отправили вам код подтверждения на ваш номер телефона.','spanish' => 'Le hemos enviado el código de confirmación a su número de teléfono.','turkish' => 'Telefon numaranıza onay kodunu gönderdik.'),
  array('id' => '1302','lang_key' => 'two_factor_description','type' => '','english' => 'Turn on 2-step login to level-up your account&#039;s security, Once turned on, you&#039;ll use both your password and a 6-digit security code sent to your phone or email to log in.','arabic' => 'شغّل تسجيل الدخول المكوَّن من خطوتين لتحسين مستوى أمان حسابك ، وبمجرد تشغيله ، ستستخدم كل من كلمة المرور ورمز الأمان المكون من 6 أرقام والمرسلين إلى هاتفك أو بريدك الإلكتروني لتسجيل الدخول.','dutch' => 'Schakel authenticatie in 2 stappen in om de beveiliging van uw account te verbeteren. Wanneer u eenmaal bent ingeschakeld, gebruikt u zowel uw wachtwoord als een uit 6 cijfers bestaande beveiligingscode die naar uw telefoon of e-mailadres is gestuurd om in te loggen.','french' => 'Activez la connexion en deux étapes pour renforcer la sécurité de votre compte. Une fois activé, vous utiliserez votre mot de passe et un code de sécurité à 6 chiffres envoyé à votre téléphone ou à un courrier électronique pour vous connecter.','german' => 'Aktivieren Sie die 2-stufige Anmeldung, um die Sicherheit Ihres Kontos zu erhöhen. Nach dem Einschalten verwenden Sie sowohl Ihr Passwort als auch einen 6-stelligen Sicherheitscode, der an Ihr Telefon oder Ihre E-Mail-Adresse gesendet wird, um sich anzumelden.','italian' => 'Attiva l&#039;accesso in due passaggi per aumentare la sicurezza del tuo account. Una volta attivato, utilizzerai sia la tua password sia un codice di sicurezza a 6 cifre inviato al tuo telefono o e-mail per accedere.','portuguese' => 'Ative o login em duas etapas para aumentar o nível de segurança da sua conta. Depois de ativada, você usará a senha e um código de segurança de seis dígitos enviados para o seu telefone ou e-mail para fazer login.','russian' => 'Включите двухэтапный вход для повышения безопасности своей учетной записи. После включения вы будете использовать как свой пароль, так и 6-значный код безопасности, отправленный на ваш телефон или электронную почту, чтобы войти в систему.','spanish' => 'Active el inicio de sesión en 2 pasos para subir de nivel la seguridad de su cuenta. Una vez que lo haya hecho, utilizará su contraseña y un código de seguridad de 6 dígitos que se le enviará a su teléfono o correo electrónico para iniciar sesión.','turkish' => 'Hesabınızın güvenliğini artırmak için 2 adımlı giriş özelliğini açın. Açtıktan sonra, giriş yapmak için hem şifrenizi hem de telefonunuza veya e-posta adresinize gönderilen 6 basamaklı bir güvenlik kodunu kullanırsınız.'),
